import React, { Component } from 'react';
import '../styles/App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <h1>
          Game 1
        </h1>
        <div className="game">
          <div className="player">
            <h2>
              Player 1
            </h2>
          </div>
          <div className="player">
            <h2>
              Player 2
            </h2>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
